script: |
  super -f text -I q10221.spq | sort > q10221.out

inputs:
  - name: q10221.spq
    data: |
      SELECT DISTINCT - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE CAST ( NULL AS INTEGER ) + - 51 + - 19 + - + col0 + + - 82 * ( - CAST ( - - col1 AS REAL ) ) * col2 + - 64 * + col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q10221.out
    data: |
